import React, { useEffect, useState } from 'react';
import axios from './api';

function Auditoria() {
    const [logs, setLogs] = useState([]);
    useEffect(() => {
        axios.get('/api/log_auditoria').then(res => setLogs(res.data));
    }, []);
    return (
        <div>
            <h2>Logs de Auditoria</h2>
            <ul>
                {logs.map(l => (
                    <li key={l.id}>{l.tipo_acao} - {l.registro_afetado} ({l.data_hora})</li>
                ))}
            </ul>
        </div>
    );
}
export default Auditoria;
